let _fslex_tables = Microsoft.FSharp.Text.Lexing.AsciiTables.Create(trans,actions)

let rec _fslex_dummy () = _fslex_dummy() 

(* Rule tokenize *)
let rec tokenize  (lexbuf : Microsoft.FSharp.Text.Lexing.LexBuffer<_>) = _fslex_tokenize  0 lexbuf
(* Rule tokenize *)
and _fslex_tokenize  _fslex_state lexbuf =
  match _fslex_tables.Interpret(_fslex_state,lexbuf) with
  | 0 ->  _fslex_tokenize 0 lexbuf           
  | 1 ->  lexbuf.EndPos <- lexbuf.EndPos.NextLine; tokenize lexbuf; 
  | 2 ->  INT(lexeme lexbuf)            
  | 3 ->  HEX(lexeme lexbuf)           
  | 4 ->  FLOAT(lexeme lexbuf )           
  | 5 ->  SYMB_ID(lexeme lexbuf)     
  | 6 ->  TYPEVAR(lexeme lexbuf)               
   | 7 ->     match keywords.TryFind(lexeme lexbuf) with
              | Some(token) -> token
              | None -> ID(lexeme lexbuf)
  | 8 ->  EOF          
  | _ -> failwith "tokenize"

